import React from "react";
import { Link } from "react-router-dom";
function Products() {
  const PRODUCTS = [
    { id: "p1", title: "product 1" },
    { id: "p2", title: "product 2" },
    { id: "p3", title: "product 3" },
  ];
  return (
    <>
      <h1>Products</h1>
      <ul>  
        {
          PRODUCTS.map(product => (
            <li>
              <Link></Link>
            </li>
          ))
        }
      </ul>
    </>
  );
}

export default Products;
